import React, { Fragment } from "react";
import { Link } from "react-router-dom";

function Home({ handleBtns }) {
  return (
    <Fragment>
      <Link to="/decks/new">
        <button
          type="button"
          className="btn btn-secondary"
          id="createDeckBtn"
          onClick={handleBtns}
        >
          Create Deck
        </button>
      </Link>
    </Fragment>
  );
}

export default Home;
